import './nav-list.css';

let menuList = [
    { id: 1, label: 'Home', link: '/' },
    { id: 2, label: 'About', link: '/about' },
    { id: 3, label: 'Store', link: '/store' },
    { id: 4, label: 'Contacts', link: '/contact' },
    { id: 5, label: 'Where to buy', link: '/foo' }
];

function menuItem({label, link}) {
    return (
        <li>
            <a href={link}>{label}</a>
        </li>
    )
}

export default function myNavListComp() {
    return (
        <ul>
            {menuList.map(item => {
                <menuItem key={item.id} label={item.label} link={item.link} />
            })}
        </ul>
    )
}
